import React, { useState } from "react";
import PracticeConsole from "../components/PracticeConsole";

const BACKTRACKING_QUESTIONS = [
  {
    title: "Letter Combinations of a Phone Number",
    difficulty: "Medium",
    description: `
Given a string containing digits from 2-9 inclusive, return all possible letter combinations that the number could represent.

A mapping of digits to letters (like on a telephone keypad) is given. Note that 1 does not map to any letters.

Example 1:
Input: digits = "23"
Output: ["ad","ae","af","bd","be","bf","cd","ce","cf"]

Example 2:
Input: digits = "2"
Output: ["a","b","c"]

Constraints:
1 <= digits.length <= 4
digits[i] is in the range ['2','9']
    `,
  },
  {
    title: "Generate Parentheses",
    difficulty: "Medium",
    description: `
Given n pairs of parentheses, write a function to generate all combinations of well-formed parentheses.

Example 1:
Input: n = 3
Output: ["((()))","(()())","(())()","()(())","()()()"]

Example 2:
Input: n = 1
Output: ["()"]

Constraints:
1 <= n <= 8
    `,
  },
  {
    title: "N-Queens",
    difficulty: "Hard",
    description: `
The n-queens puzzle is the problem of placing n queens on an n x n chessboard such that no two queens attack each other.

Given an integer n, return all distinct solutions to the n-queens puzzle.

Each solution contains a distinct board configuration where:
'Q' indicates a queen
'.' indicates empty space

Example:
Input: n = 4
Output:
[
 [".Q..","...Q","Q...","..Q."],
 ["..Q.","Q...","...Q",".Q.."]
]

Constraints:
1 <= n <= 9
    `,
    image: "/nqueens.png",
  },
];

export default function TopicPractice() {
  const questions = BACKTRACKING_QUESTIONS;

  const [currentIndex, setCurrentIndex] = useState(0);
  const [status, setStatus] = useState(
    Array(questions.length).fill("unattempted")
  );

  function handleSubmit(isCorrect) {
    const updated = [...status];
    updated[currentIndex] = isCorrect ? "correct" : "wrong";
    setStatus(updated);
  }

  function handleNext() {
    const updated = [...status];

    if (updated[currentIndex] === "unattempted") {
      updated[currentIndex] = "skipped";
    }

    setStatus(updated);

    if (currentIndex < questions.length - 1) {
      setCurrentIndex(currentIndex + 1);
    }
  }

  function goToQuestion(index) {
    setCurrentIndex(index);
  }

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        height: "100vh",
        background: "#f8fafc",
        fontFamily: "Inter, sans-serif",
      }}
    >
      {/* ---------- QUESTION NUMBER BAR ---------- */}
      <div
        style={{
          display: "flex",
          gap: 12,
          padding: "20px 40px",
          borderBottom: "1px solid #e2e8f0",
          background: "#ffffff",
        }}
      >
        {questions.map((_, i) => {
          const bg =
            status[i] === "correct"
              ? "#22c55e"
              : status[i] === "wrong"
              ? "#ef4444"
              : status[i] === "skipped"
              ? "#8b5cf6"
              : "#e2e8f0";

          const color =
            status[i] === "unattempted" ? "#1e293b" : "#ffffff";

          return (
            <div
              key={i}
              onClick={() => goToQuestion(i)}
              style={{
                width: 40,
                height: 40,
                borderRadius: 10,
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                fontWeight: 700,
                background: bg,
                color: color,
                cursor: "pointer",
              }}
            >
              {i + 1}
            </div>
          );
        })}
      </div>

      {/* ---------- MAIN SPLIT VIEW ---------- */}
      <div style={{ display: "flex", flex: 1 }}>

        {/* LEFT PANEL (Problem Description) */}
        <div
          style={{
            flex: 1,
            padding: "40px",
            overflowY: "auto",
            background: "#ffffff",
            borderRight: "1px solid #e2e8f0",
          }}
        >
          <h2 style={{ fontWeight: 700, marginBottom: 10 }}>
            {questions[currentIndex].title}
          </h2>

          <span
            style={{
              padding: "4px 10px",
              borderRadius: 20,
              fontSize: 12,
              background:
                questions[currentIndex].difficulty === "Hard"
                  ? "#fee2e2"
                  : "#e0f2fe",
              color:
                questions[currentIndex].difficulty === "Hard"
                  ? "#dc2626"
                  : "#0369a1",
            }}
          >
            {questions[currentIndex].difficulty}
          </span>

          <pre
            style={{
              marginTop: 25,
              whiteSpace: "pre-wrap",
              lineHeight: 1.6,
              color: "#334155",
              fontSize: 14,
            }}
          >
            {questions[currentIndex].description}
          </pre>

          {questions[currentIndex].image && (
            <img
              src={questions[currentIndex].image}
              alt="visual"
              style={{
                marginTop: 25,
                width: "100%",
                borderRadius: 10,
              }}
            />
          )}
        </div>

        {/* RIGHT PANEL (Code Editor) */}
        <div
          style={{
            flex: 1.2,
            display: "flex",
            flexDirection: "column",
            padding: "30px",
            background: "#f1f5f9",
          }}
        >
          <PracticeConsole />

          <div style={{ marginTop: 20, display: "flex", gap: 15 }}>
            <button
              onClick={() => handleSubmit(true)}
              style={{
                padding: "10px 20px",
                background: "#22c55e",
                color: "#fff",
                borderRadius: 8,
                border: "none",
                cursor: "pointer",
              }}
            >
              Submit (Correct)
            </button>

            <button
              onClick={() => handleSubmit(false)}
              style={{
                padding: "10px 20px",
                background: "#ef4444",
                color: "#fff",
                borderRadius: 8,
                border: "none",
                cursor: "pointer",
              }}
            >
              Submit (Wrong)
            </button>

            <button
              onClick={handleNext}
              style={{
                padding: "10px 20px",
                background: "#6366f1",
                color: "#fff",
                borderRadius: 8,
                border: "none",
                cursor: "pointer",
              }}
            >
              Next
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
